  \"2015-09-27T01:40:54.748259\",\n\t\"name\": \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-froe440b\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0115227 includes chemical,
  discrete sample, physical and profile data collected from HESPERIDES in the North
  Atlantic Ocean from 1992-06-14 to 1992-08-15 and retrieved during cruise 29HE06_1-3.
  These data include ALKALINITY, CHLOROFLUOROCARBON-11 (CFC-11), CHLOROFLUOROCARBON-12
  (CFC-12), DELTA CARBON-14, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, NITRITE, PHOSPHATE, Potential temperature (theta), SALINITY,
  SILICATE, WATER TEMPERATURE and pH. The instruments used to collect these data include
  CTD and bottle. These data were collected by Elisa F. Guallart of Consejo Superior
  de Investigaciones Cientificas, Aida F. Rios and Fiz Perez of Instituto de Investigaciones
  Marinas de Vigo, Frank J. Millero of Rosenstiel School of Marine and Atmospheric
  Science and Gabriel Rosou00c3u008cu00c2u0081n of Universidad de Vigo (University
  of Vigo) as part of the WOCE_A05 data set.nnThe World Ocean Circulation Experiment
  (WOCE) was a major component of the World Climate Research Program with the overall
  goal of better understanding the ocean's role in climate and climatic changes resulting
  from both natural and anthropogenic causes. The CO2 survey took advantage of the
  sampling opportunities provided by the WOCE Hydrographic Program (WHP) cruises during
  this period between 1990 and 1998. The final collection covers approximately 23,000
  stations from 94 WOCE cruises.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
